      "price": 12222,
      "condition": "Nuevo",
      "description": "<p>// NO FUNCIONA CON CLARO</p><p>// NO FUNCIONA CON CLARO</p><p>// NO FUNCIONA CON CLARO</p><p>// NO FUNCIONA CON CLARO</p><p>// NO FUNCIONA CON CLARO</p><p>// NO FUNCIONA CON CLARO</p><br><p>L A T I T U D E S • S U R //</p><p>¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨</p><p>- PRODUCTO NUEVO - CAJA CERRADA -</p><br><p>ENVÍOS AL INTERIOR POR:</p><p>- Mercadoenvíos - GRATUITO -</p><p>- Expresos, Jetpack.</p><br><p>ENVÍOS DENTRO DE C.A.B.A Y G.B.A:</p><p>- Motomensajería (Consultar costo)</p><p>- Mercadoenvíos - GRATUITO –</p><br><p>FORMAS DE PAGO:</p><p>- MercadoPago, Tarjeta de Crédito o Débito</p><br><p>NUESTRO HORARIO DE ATENCIÓN ES DE 11 A 17 DE LUNES A VIERNES.</p><br><p>UBICACIÓN:</p><p>- Nos encontramos en el barrio de COLEGIALES.</p><p>Transporte: Línea D ESTACIÓN MINISTRO CARRANZA/ Colectivos: 39, 41, 67, 68, 108, 110, 140, 151, 168</p><br><p>•••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••</p><p>Descripción del producto</p><br><p>Procesador Dimensity 800 + SO Android 11</p><p>Entra en la nueva era de 5G con Ulefone Armor 11T 5G. Está alimentado por el chipset MediaTek Dimensity 800 5G, que adopta una tecnología de proceso de 7 nm y potentes arquitecturas de CPU, puede proporcionarle un rendimiento potente y estable, multitarea fluida, experiencia audiovisual y de juego sin problemas.</p><br><p>IP68 impermeable, a prueba de polvo y a prueba de caídas</p><p>Probado según los exigentes estándares resistentes, como las clasificaciones IP68 / IP69K, el Armor 11T 5G puede manejarse en cualquier entorno en el que se adentre. No es solo un teléfono a prueba de salpicaduras, sino un dispositivo verdaderamente impermeable.</p><br><p>Cámara trasera triple de 48MP + escáner de cámara de imagen térmica</p><p>El teléfono resistente Armor 11T cuenta con un sensor de imagen de resolución ultra alta de 48MP con tecnología Te-tracell y 3D HDR, que le permite capturar imágenes y videos más detallados. Y tiene una cámara termográfica incorporada que localiza la fuente de calor y la traduce en una imagen térmica que puede ver la temperatura, lo cual es importante en el mantenimiento eléctrico y de tuberías, aventuras al aire libre, rescates de emergencia.</p><br><p>5200 mAh batería grande</p><p>Con la tecnología de carga rápida de 15 W, ya sea que pase su tiempo viendo películas, jugando, revisando la navegación o haciendo llamadas telefónicas, Ulefone Armor 11 5G le proporcionará la energía que necesita. Los aventureros ya no tienen que preocuparse por quedarse sin batería cuando exploran la naturaleza.</p><br><p>Cámara de imagen térmica + cámara trasera triple de 48MP + cámara frontal de 16MP</p><p>Lepton con tecnología MSX</p><br><p>La cámara de imagen térmica integrada, con tecnología MSX, en los teléfonos inteligentes Ulefone Armor 11T 5G puede detectar objetos en la escena y crear imágenes térmicas basadas en la temperatura. Podrá ver anomalías como pérdida o ganancia de calor, encontrar animales o personas en la oscuridad y diagnosticar y resolver problemas rápidamente. Una cámara termográfica puede desempeñar un papel importante en el mantenimiento eléctrico y de líneas, aventuras al aire libre, rescates de emergencia y más.</p><br><p>Cámara principal de 48MP</p><br><p>La cámara principal de 48MP proporciona un rendimiento de imagen de alta definición. Puede ampliar las imágenes sin perder claridad de imagen. Con una apertura de f / 1,79, puede atravesar más luz, lo que hace que Armor 11T 5G siga funcionando bien en la fotografía nocturna.</p><br><p>Lente macro de 2MP</p><br><p>El mundo es suyo para descubrirlo desde cerca de 4 cm. La lente macro puede ayudarlo a tomar fotografías de primeros planos extremos de objetos diminutos en detalle. No importa los delicados patrones de color en la pluma de un pavo real o la textura de una hoja, Ulefone Armor 11T 5G te lo mostrará claramente.</p><br><p>Cámara frontal de alta resolución de 16MP</p><br><p>La cámara de 16MP de alta resolución puede capturar detalles diminutos como pelos y pestañas individuales, grabar sin esfuerzo su brillo en cada paso del camino.Con la apertura f / 2.0 y el algoritmo de embellecimiento avanzado, puede tomar selfies claros y naturales fácilmente.</p><br><p>HyperFast 5G cambia su forma de trabajar y jugar</p><p>Teóricamente, la red 5G viene con una velocidad hasta 10 veces más rápida que la 4G. Podrá experimentar juegos y transmisiones prácticamente sin problemas, descargas HyperFast, videollamadas HD nítidas y más. Con una colaboración en línea fluida y un intercambio de archivos ultrarrápido, su productividad laboral será mucho mayor.</p><br><p>Conjunto de chips MediaTek Dimensity 800 5G y 8 GB de RAM + 256 GB de ROM</p><p>Adopte la velocidad ultrarrápida con un chipset MediaTek Dimensity 800 5G SoC 5G totalmente integrado. Gracias a la tecnología de proceso insignia de 7nm y las potentes arquitecturas de CPU, Ulefone Armor 11T 5G puede lograr un alto rendimiento, bajo consumo de energía y fluidez del sistema. Con la GPU premium Arm Mali-G57 MC4 con MediaTek HyperEngine 2.0, le brindará los mejores juegos experiencia y calidad de imagen.</p><br><p>Especificaciones:</p><p>Sistema: Android 11</p><p>Almacenamiento: 8 GB de RAM + 256 GB de ROM (no admite tarjeta SD)</p><p>Cámara: cámara triple de 48MP + 2MP + 2MP + cámara frontal de 16MP + cámara de imagen térmica de 5MP (FOV76 °, F / 2.2)</p><p>Procesador: MediaTek Dimensity 800 con 5G, Octa Core, hasta 2.0GHz</p><p>Pantalla: Pantalla HD + de 6,1 pulgadas | Resolución 1560 * 720</p><p>Batería: 5200 mAh, admite carga inalámbrica de 10 W (estándar Qi) y carga rápida, tipo C, 9V2A</p><p>Celular: 2G / 3G / 4G / 5G | Tarjeta Dual Nano SIM desbloqueada</p><p>NFC: compatible con Google Pay</p><p>OTG: admite carga inversa e intercambio de datos entre diferentes dispositivos</p><p>GPS: GPS + GLONASS + BeiDou + Galileo + Brújula electrónica</p><p>Modo de desbloqueo: ID de rostro / huella digital</p><p>Sensor: sensor de aceleración, sensor G, sensor P, sensor L, giroscopio, baroceptor, coulombímetro</p><br>",
